const Footer = () => {
   return (
      <div
         id="footer"
         className="d-flex
          m-0 border-top py-2 text-center bg-light"
      >
         <div className="d-flex flex-column">
            <i class="bi bi-heart-fill fs-3 "></i>
            <span>Favorites</span>
         </div>
         <div className="d-flex flex-column">
            <i class="bi bi-heart-fill fs-3 "></i>
            <span>Favorites</span>
         </div>
         <div className="d-flex flex-column">
            <i class="bi bi-heart-fill fs-3 "></i>
            <span>Favorites</span>
         </div>
      </div>
   );
};

export default Footer;
